import React, {lazy,Suspense} from "react";
import {Routes, Route} from 'react-router-dom';

const Home = lazy(() => import('../Layout/layout'));
const Courses = lazy(() => import('../components/dashboard'));
const Webinar = lazy(() => import('../components/courses'));
// const NotFound = lazy(() => import('./components/404'));


const Ui_Router = () =>{
    return (
        <Suspense fallback="Loading...">
            <Routes>
                <Route path={'/'} element={<Home/>}>
                    <Route path={'/dashboard'} element={<Courses/>}/>
                    {/* <Route path={'/blogs'} element={<Webinar/>}/> */} 
                    </Route>
                {/* <Route path='*' element={<NotFound/>}/> */}
            </Routes>
        </Suspense>
    )
}

export default Ui_Router;
